import React, { Component } from "react";
import Wrapper from "../Wrapper";
import Button from "@material-ui/core/Button";
import axios from "axios";
import ReactToPrint from "react-to-print";
import ComponentToBePrinted from "./componentToBePrinted";

class PrintedForm extends Component {
  constructor(props) {
    super(props);
    this.state = {
      ticket: {},
      printView:false
    };
    console.log(this.props);
    this.printPage = this.printPage.bind(this);

  }
  componentDidMount() {
    if (this.props.history.location.state != null) {
        let query = this.props.history.location.state.ticket;
        axios
          .get("/ticket/ticket", {
            params: {
              id: query,
            },
          })
          .then((response) => {
            console.log(response.data);
            this.setState({ ticket: response.data });
            console.log(this.state)
          })
          .catch((error) => {
            console.log(error);
          });
      }
  }
  printPage(){
      this.setState({printView: true})
  }

  render() {
    const { ticket,printView } = this.state;
    var Barcode = require("react-barcode");
    return (
      <div>
          {printView == false ?  <Wrapper>
            <Button variant="contained" color="secondary" onClick={this.printPage} style={{float:"right"}}>
                Print
              </Button>
        <div style={{ display: "inline-flex" }}>
            <div style={{ margin: "auto" }}>
              <div
                style={{
                  width: "500px",
                  height: "auto",
                  border: "1px solid #adadad",
                }}
              >
                <div
                  style={{
                    width: "100%",
                    display: "inline-flex",
                    padding: "20px",
                  }}
                >
                  <div style={{ margin: "auto" }}>Logo</div>
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    Korrieri
                  </div>
                  <div style={{ margin: "auto" }}>
                    Agjensia:{" "}
                    <span style={{ fontWeight: "bold" }}>Emer agjensie</span>
                  </div>
                </div>
              </div>
              <div
                style={{
                  width: "500px",
                  height: "auto",
                  border: "1px solid #adadad",
                }}
              >
                <div
                  style={{
                    width: "100%",
                    display: "inline-flex",
                    padding: "20px",
                  }}
                >
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    DERGUESI
                  </div>
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    MARRESI
                  </div>
                </div>
              </div>
              <div
                style={{
                  width: "500px",
                  height: "auto",
                  border: "1px solid #adadad",
                }}
              >
                <div
                  style={{
                    width: "100%",
                    display: "inline-flex",
                    padding: "20px",
                  }}
                >
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    <span style={{ color: "#717171" }}>SUBJEKTI </span>
                    <p>
                      {ticket?.users?.firstName} {ticket?.users?.lastName}
                    </p>
                  </div>
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    <span style={{ color: "#717171" }}>SUBJEKTI </span>
                    <p>
                      {ticket?.firstName} {ticket?.lastName}
                    </p>{" "}
                  </div>
                </div>
              </div>
              <div
                style={{
                  width: "500px",
                  height: "auto",
                  border: "1px solid #adadad",
                }}
              >
                <div
                  style={{
                    width: "100%",
                    display: "inline-flex",
                    padding: "20px",
                  }}
                >
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    <span style={{ color: "#717171" }}>KONTAKTI </span>
                  </div>
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    <span style={{ color: "#717171" }}>KONTAKTI </span>
                  </div>
                </div>
              </div>
              <div
                style={{
                  width: "500px",
                  height: "auto",
                  border: "1px solid #adadad",
                }}
              >
                <div
                  style={{
                    width: "100%",
                    display: "inline-flex",
                    padding: "20px",
                  }}
                >
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    <span style={{ color: "#717171" }}>RRUGA/FSHATI </span>
                    <p>{ticket?.users?.address}</p>
                  </div>
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    <span style={{ color: "#717171" }}>RRUGA/FSHATI </span>
                    <p>{ticket?.address}</p>
                  </div>
                </div>
              </div>
              <div
                style={{
                  width: "500px",
                  height: "auto",
                  border: "1px solid #adadad",
                }}
              >
                <div
                  style={{
                    width: "100%",
                    display: "inline-flex",
                    padding: "20px",
                  }}
                >
                  <div
                    style={{
                      margin: "auto",
                      fontWeight: "bold",
                      display: "inline-flex",
                    }}
                  >
                    <div style={{ margin: "auto" }}>
                      <span style={{ color: "#717171" }}>Qyteti </span>
                      <p>TIRANE</p>
                    </div>
                    <div style={{ margin: "auto", marginLeft: "30px" }}>
                      <span style={{ color: "#717171" }}>KODI POSTAR </span>
                      <p>1001</p>
                    </div>
                  </div>
                  <div
                    style={{
                      margin: "auto",
                      fontWeight: "bold",
                      display: "inline-flex",
                    }}
                  >
                    <div style={{ margin: "auto" }}>
                      <span style={{ color: "#717171" }}>Qyteti </span>
                      <p>{ticket?.city?.city}</p>
                    </div>
                    <div style={{ margin: "auto", marginLeft: "30px" }}>
                      <span style={{ color: "#717171" }}>KODI POSTAR </span>
                      <p>100</p>
                    </div>
                  </div>
                </div>
              </div>
              <div
                style={{
                  width: "500px",
                  height: "auto",
                  border: "1px solid #adadad",
                }}
              >
                <div
                  style={{
                    width: "100%",
                    display: "inline-flex",
                    padding: "20px",
